import Header from "../Header/Header"
import BookTable from "../AdminBookPage/BookTable";
import ClientHomePage from "../ClientPage/Client Page";

const MainPage = () => {
  return (
    <>
      <Header />
      {
        localStorage.getItem("token") === "client"
          ? (<ClientHomePage />)
          : (<BookTable />)
      }
    </>

  );
};

export default MainPage;
